var employees = udm:(СОРТИРОВАТЬ((ФИЛЬТРОВАТЬ(Schedule:employee:По_офису(js:Schedule:office(office)), "[is_active = true]"), "[workstation]", "[УБЫВ]")));

// 2. Получаем активные рабочие места
var workstations = udm:(ФИЛЬТРОВАТЬ(Schedule:workstations:По_офису(js:Schedule:office(office)), "[is_active = true]"));

// 3. Получаем рабочие даты только за выбранный месяц
var dates = udm:(Schedule:calendar_dates:По_месяцу(js:целое(targetMonth)));

// 4. Получаем все утверждённые отпуска
var vacations = udm:(ФИЛЬТРОВАТЬ(Schedule:vacations:По_месяцу(js:целое(targetMonth)), "[is_approved = true]"));

// локальное хранилище занятых мест
var assigned = {};

var count_work_by_date = new Array(NUM_COL); // вспомогательный массив для дашборда
for (var i = 0; i < NUM_COL; i++) {
    count_work_by_date[i] = 0;
}


function isSameEmployee(e1, e2) {
    return udm:(js:Schedule:employee(e1) == js:Schedule:employee(e2));
}

function isSameWorkstations(e1, e2) {
    return udm:(js:Schedule:workstations(e1) == js:Schedule:workstations(e2));
}

function isSameAt_status(e1, e2) {
    return udm:(js:Schedule:at_status(e1) == js:Schedule:at_status(e2));
}

function at_status_to_str(st) {
    if (isSameAt_status(st, udm:(Schedule:at_status:Р))) {
        return "Р";
    }
    else if (isSameAt_status(st, udm:(Schedule:at_status:ОТ))) {
        return "ОТ";
    }
    else if (isSameAt_status(st, udm:(Schedule:at_status:В))) {
        return "В";
    }
    else if (isSameAt_status(st, udm:(Schedule:at_status:У))) {
        return "У";
    }
    else {
        return "";
    }
}

function str_to_workstations(ws_str, ws_office) {
    return udm:(Schedule:workstations:По_названию_и_офису(js:строка(ws_str), js:Schedule:office(ws_office))[0]);
}


