function findMaxWorkDayRandom(ind_working_days, count_work_by_date) {
    // Находим максимальное количество сотрудников среди рабочих дней человека
    var maxCount = -1;
    var maxIndices = [];
    
    // Проходим по всем рабочим дням человека
    for (var i = 0; i < ind_working_days.length; i++) {
        var count = count_work_by_date[ind_working_days[i]];
        
        if (count > maxCount) {
            maxCount = count;
            maxIndices = [i]; // начинаем новый список максимальных
        } else if (count === maxCount) {
            maxIndices.push(i); // добавляем к существующему списку
        }
    }
    
    // Если нет подходящих дней, возвращаем -1
    if (maxIndices.length == 0) {
        return -1;
    }
    
    // Случайный выбор из максимальных индексов
    var randomIndex = Math.floor(Math.random() * maxIndices.length);
    return maxIndices[randomIndex];
}


