    for (var j = 0; j < dates.length; j++) {
        var d = dates[j].date;

        var coll_index = udm:(ДЕНЬ(js:datetime(d))) - 1;

        // инициализация массива занятых для дня
        if (!assigned[d]) {
            assigned[d] = [];
        }

        // проверка: отпуск ли у сотрудника в этот день
        var is_vac_today = false;
        for (var v = 0; v < vacations.length; v++) {
            if (isSameEmployee(vacations[v].employee, emp) &&
                vacations[v].date_from <= d &&
                vacations[v].date_to >= d) {
                is_vac_today = true;
                break;
            }
        }

        coll_date[coll_index] = d;

        // выбираем рабочее место
        var ws = emp.workstation;

        if (is_vac_today) {
